          <input type="text" name="email" id="" value="Email" />
          <input type="text" name="telefon" id="" value="Telefon" />
        </div>
        <textarea
          name="szoveg"
          id=""
          cols="30"
          rows="10"
          value="Szoveg"
        ></textarea>
      </div>
    );
  }
}

